import React from 'react';

const Categories = ({categories, filterItems}) => {
  return (
    <div className="btn-container">
      {
        categories.map((category)=>{
          <button className="filter-btn" 
                  type="button"
                  onClick={()=>filterItems}>
            {category}
          </button>
        })
      }
    </div>
    );
};

export default Categories;
